import React from 'react'
import pic from './productivity.png';

export default function Banner() {
    return (
        <div>
            <div id="navBar" style={{margin: '20px'}}>
                <h1>Logo</h1>
            </div>
            <img src={pic} style={{width: '100%'}} alt="this is image" />
        </div>
    )
}
